 __u8 Model1_eddbuf_entries; /* 0x1e9 */
 __u8 Model1_edd_mbr_sig_buf_entries; /* 0x1ea */
 __u8 Model1_kbd_status; /* 0x1eb */
 __u8 Model1__pad5[3]; /* 0x1ec */
